import { Redirect } from "react-router"

export default function ShowButton(props){
    const ChangeRoute = () =>{
        <Redirect to={"/menutable/" + props.value} />
    }
    return (
        <>
            <button
            onClick={ChangeRoute}>
               {props.value}
            </button>
        </>
    )
}
